import React, { Component } from 'react';
import './about.css';
import { Card, CardImg, CardText, CardBody,
    CardTitle, CardSubtitle, Button } from 'reactstrap';
  

class Member extends Component {
    constructor(props){
        super(props);
    }

    render() {
        return (
            <div>
                <Card>
                    <CardImg top src={this.props.person.image} alt="Card image cap" />
                    <CardBody>
                        <CardTitle>{this.props.person.name}</CardTitle>
                        <CardSubtitle>{this.props.person.major}</CardSubtitle>
                        <hr className="member-card-separator" />
                        <CardText>{this.props.person.description}</CardText>
                        <Button>More Info</Button>
                    </CardBody>
                </Card>
            </div>
        );
    }
}

export default Member;
